
CREATE TEMPORARY TABLE `tempObject` (
	guid INT,
    mapId INT,
    areaId INT,
    zoneId INT
);


UPDATE 
	`gameobject` 
INNER JOIN
	`tempObject`
ON
	(`gameobject`.`guid` = `tempObject`.`guid`)
SET
	`gameobject`.`zoneId` = `tempObject`.`zoneId`,
	`gameobject`.`map` = `tempObject`.`mapId`,
    `gameobject`.`areaId` = `tempObject`.`areaId`;
    
DROP TABLE `tempObject`;
